import React from 'react'
import LibrarySong from './LibrarySong'
const Library = ({
    setCurrentSong,
    songs,
    setSongs,
    audioRef,
    isplaying,
    libraryStatus
  }) => {
    return ( <
        div className = {
          `library ${libraryStatus && "active-library"}`
        } >
        <
        h2 > Library < /h2> <
        div className = "library-songs" > {
          songs.map(song => < LibrarySong song = {
              song
            }
            songs = {
              songs
            }
            setCurrentSong = {
              setCurrentSong
            }
            key = {
              song.id
            }
            audioRef = {
              audioRef
            }
            isplaying = {
              isplaying
            }
            setSongs = {
              setSongs
            }
            id = {
              song.id
            }
            /> )} <
            /div> <
            /div>
          )
        }

        export default Library
